function createMap(s) {
    let map = new Map();
    for (let i = 0; i < s.length; i++) {
        if (map.has(s[i])) {
            const currentVal = map.get(s[i]);
            if (currentVal > 0) {
                map.set(s[i], currentVal + 1);
            }
        } else {
            map.set(s[i], 1);
        }
    }
    return map;
}
function reverseKeyValues(map) {
    let reverseMap = new Map();
    map.forEach((val, key) => {
        const values = (reverseMap.has(val)) ? reverseMap.get(val) : [];
        values.push(key)
        reverseMap.set(val, values)
    })
    return reverseMap;
}
function isValid(s) {
    let map = createMap(s);
    let reverseMap = reverseKeyValues(map);
    console.log(reverseMap);

    if (reverseMap.size === 1) return 'YES';
    if (reverseMap.size > 2) return 'NO';

    let oddCharIsInMoreThanOncePlace;
    let isThereMoreThanOneOddChar;
    const keyIterator = reverseMap.keys();
    const val1 = keyIterator.next().value;
    const val2 = keyIterator.next().value;
    const charSet1 = reverseMap.get(val1);
    const charSet2 = reverseMap.get(val2);
    if ((charSet1.length === 1 && val1 === 1) || (charSet2.length === 1 && val2 === 1)) {
        return 'YES';
    }
    isThereMoreThanOneOddChar = charSet1.length > 1 && charSet2.length > 1
    oddCharIsInMoreThanOncePlace = Math.abs(val1 - val2) > 1;

    return (!isThereMoreThanOneOddChar && !oddCharIsInMoreThanOncePlace) ? 'YES' : 'NO';
}
console.log(isValid('aabbcd'));
console.log(isValid('aabbccddeefghi'));
console.log(isValid('abcdefghhgfedecba'));
console.log(isValid('abccc'));
console.log(isValid(''));
